create table Person (
	uuid VARCHAR(40),
	valid_from DATE,
	valid_to DATE,
	fullName VARCHAR(50),
	firstName VARCHAR(50),
	lastName VARCHAR(50),
	title VARCHAR(50),
	salutation VARCHAR(50),
	IsCustomer VARCHAR(50),
	gender VARCHAR(50),
	placeOfBirth VARCHAR(50),
	countryOfBirth VARCHAR(50),
	nationality VARCHAR(50),
	martialStatus VARCHAR(50),
	birthDate DATE,
	deathDate DATE,
	formattedName VARCHAR(50),
	location VARCHAR(50),
	satus VARCHAR(50),
	club VARCHAR(50)
);
